import {ReactElement} from "react";
import {TableCell, TableHead, TableRow, TableSortLabel} from "@material-ui/core";
import {Order, Translation} from "../utils/types";
import {APP_ID, CONTEXT, DE, EN, FR, IT, LAST_CALL, STAGE, TEXT_ID} from "../utils/constants";

interface HeadCell {
    id: keyof Translation,
    label: string
}

const headCells: HeadCell[] = [
    {id: APP_ID, label: 'App-ID *'},
    {id: CONTEXT, label: 'Kontext *'},
    {id: TEXT_ID, label: 'Text-ID *'},
    {id: STAGE, label: 'Stage *'},
    {id: DE, label: 'Deutsch'},
    {id: FR, label: 'Französisch'},
    {id: IT, label: 'Italienisch'},
    {id: EN, label: 'Englisch'},
    {id: LAST_CALL, label: 'Letzter Aufruf'}
];

interface TableProps {
    handleSort: (property: keyof Translation) => void,
    order: Order,
    orderBy: string
}

function CustomTableHead(props: TableProps): ReactElement {
    const {order, orderBy, handleSort} = props;

    function mapHeadCellToTableCell(headCell: HeadCell): ReactElement {
        return (
            <TableCell
                className={"tableHeadField"}
                key={headCell.id}
                sortDirection={orderBy === headCell.id ? order : false}
            >
                <TableSortLabel
                    active={orderBy === headCell.id}
                    direction={orderBy === headCell.id ? order : Order.asc}
                    onClick={() => handleSort(headCell.id)}
                >
                    {headCell.label}
                </TableSortLabel>
            </TableCell>
        )
    }

    return (
        <TableHead className={"tableHead"}>
            <TableRow>
                {headCells.map((headCell: HeadCell) => mapHeadCellToTableCell(headCell))}
                <TableCell/>
                <TableCell/>
            </TableRow>
        </TableHead>
    );
}

export default CustomTableHead;
